'use client'
import './App.css';
import { PythonProvider } from 'react-py';
import NavBar from './components/NavBar';
import CodeEditor from './components/CodeEditor';

function App() {
  const user = {
    name: "User",
    profilePicture: "coding-asst/frontend_react/public/logo512.png",
  }
  return (
    <PythonProvider>
      <NavBar user={user}/>
      <main>
        <CodeEditor />
      </main>
    </PythonProvider>
  )
}

export default App;
